INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "あたしだって\nやるときはやるよ！", 102601, 24001, 24, 0, "2030/12/17 14:59:59", 1, 1, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 102601, 24002, 24, 1, "2030/12/17 14:59:59", 1, 1, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 102601, 24003, 24, 2, "2030/12/17 14:59:59", 1, 1, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "やったね！\nこれでようやく\nサボれるよ…", 102601, 24004, 24, 3, "2030/12/17 14:59:59", 2, 2, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601, 24005, 24, 4, "2030/12/17 14:59:59", 1, 1, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601, 24006, 24, 5, "2030/12/17 14:59:59", 2, 2, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "あたしも意外と\nやるもんでしょ？", 102601, 24007, 24, 6, "2030/12/17 14:59:59", 2, 2, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601, 24008, 24, 7, "2030/12/17 14:59:59", 4, 4, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 102601, 24009, 24, 8, "2030/12/17 14:59:59", 4, 4, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 102601, 24010, 24, 9, "2030/12/17 14:59:59", 4, 4, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "やられた…\nねずみって意外と\nてごわいね", 102601, 24011, 24, 10, "2030/12/17 14:59:59", 4, 4, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 102601, 24012, 24, 11, "2030/12/17 14:59:59", 4, 4, 10040, 0.0, "リン", 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", 102601, 24013, 24, 12, "2030/12/17 14:59:59", 4, 1, 10040, 1.81, "リン", 0.0);
